<Br>
H22年11月にフルモデルチェンジされたセレナのオーディオレス車など、日産ワイドサイズ窓口付車（20Pコネクター仕様、4Pオプションコネクター付車）に対応した取付キットです。<br>
<br>
電源コネクターは日産の20Pタイプ。アンテナ変換コネクターほか、オプション用コネクター(4P)を同梱し、ナビゲーション取付け時の車速／パーキング信号線取出しを容易にします。<br><br>
横幅の広い日産ワイドサイズ窓口の車に、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。<br>
